import { React, useState } from 'react'
import { Link, useHistory } from "react-router-dom";
import "./style.css"

function get_playlist_id(URL){
    //https://www.youtube.com/watch?v=EwdsnGfrd-k&list=PL7RVBKKO9UqyEr8kqLe9152SIktQjDl64
    return URL.split("=")[2]
}

function App(props) {
    const { fullURL } = props.userDetails;
    const playlist_ID = fullURL.split("=")[2]
    return (
        <div class="jumbotron text-center">

            <h1>Conversion Page</h1>
            {fullURL ? (
                <h3>{`${fullURL}`}</h3>
            ) : (
                <p>No URL entered</p>
            )}

            <button type="button" onClick={() => props.onClear()}>
                clear
            </button>
            <button>
                <Link to="/">Go back </Link>
            </button>
            <p><script>{`${playlist_ID}`}</script></p>
        </div>
    )
}

export default App
